angular.module("app.templates", []).run(["$templateCache", function($templateCache) {$templateCache.put("app/features/social/templates/wall.template.html","<div layout=\"column\"><div layout-gt-sm=\"row\"><md-content flex=\"\" layout=\"column\" layout-align=\"center\" style=\"height: 90vh\"><md-content class=\"tweets-wall\" layout=\"column\" flex=\"\" layout-wrap=\"\" layout-padding=\"\" layout-margin=\"\" style=\"display: block\"><md-card ng-repeat=\"tweet in wallController.tweets | limitTo: 50\"><md-card-header><md-card-avatar><img class=\"md-user-avatar\" ng-src=\"{{tweet.user.profile_image_url}}\"></md-card-avatar><md-card-header-text><span class=\"md-title\">{{tweet.user.name}}</span><span class=\"md-subhead\">@{{tweet.user.screen_name}}</span></md-card-header-text></md-card-header><md-card-content><p>{{tweet.text}}</p></md-card-content></md-card></md-content></md-content><div class=\"gallery-wall\" flex=\"50\"></div></div><div layout=\"column\" layout-align=\"center center\"><h1>Participantes</h1><md-content layout=\"row\" layout-wrap=\"\" layout-align=\"center center\"><div ng-repeat=\"(key, prop) in mainController.participants\"><div ng-switch=\"\" on=\"mainController.participants[key].github ? \'github\' : \'twitter\' \"><a ng-switch-when=\"twitter\" target=\"_blank\" ng-href=\"http://twitter.com/{{mainController.participants[key].twitter}}\"><img ng-src=\"https://twitter.com/{{mainController.participants[key].twitter}}/profile_image?size=original\" height=\"120px\" width=\"120px\" alt=\"\"></a><a ng-switch-when=\"github\" target=\"_blank\" ng-href=\"http://github.com/{{mainController.participants[key].github}}\"><img ng-src=\"https://avatars.githubusercontent.com/{{mainController.participants[key].github}}?s=120\" height=\"120px\" width=\"120px\" alt=\"\"></a></div></div></md-content><div flex=\"5\"></div></div></div>");}]);